import React from "react";
import CareerRecommendations from "./components/CareerRecommendations";
import ResumeScreening from "./components/ResumeScreening";

function App() {
  return (
    <div className="App">
      <CareerRecommendations />
      <hr />
      <ResumeScreening />
    </div>
  );
}

export default App;
